const identity = (value) => value;
const debounce = (func, waitFor = 100) => {
  let timeout;
  return (...args) => {
    const later = () => {
      clearTimeout(timeout);
      func(...args);
    };
    clearTimeout(timeout);
    timeout = setTimeout(later, waitFor);
  };
};
export {
  debounce,
  identity
};
